// libera o campo de entrada de dados de acordo com o tipo de flexão
function dv_Entendi(){
    document.getElementById("dv-entrada-de-dados-servico").style.display = "block";
    document.getElementById("dv-rodape").style.display = "block";
    document.getElementById("dv-explicacao-servico").style.display = "none";


    tipo = sessionStorage.getItem("dv-tipo-flexao");

    if(tipo === "reta"){
        document.getElementById("dv-flexao-reta").style.display = "block";
        document.getElementById("dv-flexao-obliqua").style.display = "none";
    }
    if(tipo === "obliqua"){
        document.getElementById("dv-flexao-obliqua").style.display = "block";
        document.getElementById("dv-flexao-reta").style.display = "none";
    }


}

function dv_SalvarValores(){

    flechai = document.getElementById("dv-flechai").value;
    flechaf = document.getElementById("dv-flechaf").value;

    flechaix = document.getElementById("dv-flechai-x").value;
    flechafx = document.getElementById("dv-flechaf-x").value;
    flechaiy = document.getElementById("dv-flechai-y").value;
    flechafy = document.getElementById("dv-flechaf-y").value;

    tipo = sessionStorage.getItem("dv-tipo-flexao");

    if(tipo === "reta"){

        if(flechai === "" || flechai === 0){
            alert("Valor da flecha instantânea não informado");
        }
        else{
            flechai = flechai/1000;
            sessionStorage.setItem("dv-flechai", flechai);
        }
        if(flechaf === "" || flechaf === 0){
            alert("Valor da flecha final não informado");
        }
        else{
            flechaf = flechaf/1000;
            sessionStorage.setItem("dv-flechaf", flechaf);
        }
    }
    if(tipo === "obliqua"){

        if(flechaix === "" || flechaix === 0){
            alert("Valor da flecha instantânea em x não informado");
        }
        else{
            flechaix = flechaix/1000;
            sessionStorage.setItem("dv-flechai-x", flechaix);
        }
        if(flechafx === "" || flechafx === 0){
            alert("Valor da flecha final em x não informado");
        }
        else{
            flechafx = flechafx/1000;
            sessionStorage.setItem("dv-flechaf-x", flechafx);
        }
        if(flechaiy === "" || flechaiy === 0){
            alert("Valor da flecha instantânea em y não informado");
        }
        else{
            flechaiy = flechaiy/1000;
            sessionStorage.setItem("dv-flechai-y", flechaiy);
        }
        if(flechafy === "" || flechafy === ""){
            alert("Valor da flecha final em y não informado");
        }
        else{
            flechafy = flechafy/1000;
            sessionStorage.setItem("dv-flechaf-y", flechafy);
        }
    }

    if(tipo ==="reta"){
        if((flechaf != "" || flechaf != 0) && (flechai != "" || flechai != 0)){
            document.getElementById("dv-calculos-ELS").style.display = "block";
            document.getElementById("resposta-els-reta").style.display = "block";
        }
    }
    if(tipo === "obliqua"){
        if((flechaix != "" || flechaix != 0) && (flechaiy != "" || flechaiy != 0) && (flechafx != "" || flechafx != 0) && (flechafy != "" || flechafy != 0)){
            document.getElementById("dv-calculos-ELS").style.display = "block";
            document.getElementById("resposta-els-obl").style.display = "block";
        }
    }

}

function dv_Fluencia(){

    classe = sessionStorage.getItem("dv-classe-de-umidade");
    classe = Number(classe);

    tipo = 0;

    if(classe === 1){
        tipo = 0.6;
    }
    if((classe === 2) || (classe === 3)){
        tipo = 0.8;
    }
    if(classe === 4){
        tipo === 2;
    }

    sessionStorage.setItem("dv-fluencia", tipo);

}

